import { StatusBar } from 'expo-status-bar';
import { StyleSheet, Text, View, SafeAreaView, Image, TouchableWithoutFeedback, Button, Alert, Platform } from 'react-native';

export default function App() {
  const handlePress = () => {
    console.log('handle press');
  }
  return (
    <SafeAreaView style={[styles.container, containerStyle]}>
      <Text style={styles.textColor}>Girish Chauhan</Text>
      <Text style={styles.textColor}>iOS Developer</Text>
      <Text>&</Text>
      <Text style={styles.textColor}>React Native Programer</Text>
      <Text style={{ padding: 25 }} numberOfLines={2} onPress={handlePress}>Open up App.js to start working on your app A really really long text long react native text no need more i want see what happen in text</Text>
      <TouchableWithoutFeedback style={{ padding: 20 }}
        onPress={() => { console.log('image tapped') }}>
        <Image
          blurRadius={0}
          source={{
            width: 200,
            height: 300,
            uri: "https://picsum.photos/200/300"
          }} />
      </TouchableWithoutFeedback>
      <Button
        color={'orange'}
        title='Show Alert'
        onPress={() => {
          Alert.alert('My title',
            'My message this alert is dyanamic',
            [{ text: 'YES', onPress: () => { console.log('alert yes preess') } },
            { text: 'NO', onPress: () => { console.log('No presss') } }])
        }} />
      <Button
        color={'orange'}
        title='Alert Promt'
        onPress={() => {
          Alert.prompt('My title', 'My message info', text => console.log(text));
        }}
      />
      <StatusBar style="auto" />
    </SafeAreaView>
  );
}
const containerStyle = { backgroundColor: "#ed89" };

const styles = StyleSheet.create({
  container: {
    flex: 1,
    backgroundColor: '#fff',
    //paddingTop: Platform.OS === 'android' ? 20 : 50
    //paddingTop: Platform.OS === 'android' ? StatusBar.currnetHeight : 50,
    justifyContent: 'center',
    alignItems: 'center'

  },
  textColor: {
    color: '#228C22',
    fontSize: 21,
    fontWeight: '700'
  }
});
